FL=''
HEAD=''
RESHTML=''
RES_SVG=''
RES=0
F='tip.'
DT=$(date +%Y-%m-%d_%H-%M-%S)

function tip_head(){
	# $1 - $S Первая строка из файла tip.txt
	# $2 - $F Имя конечного файла
	echo -e "<div class=\"tip\"><h3>$1</h3>\n<pre style=\"font-size:"$((FS-4))"pt\">" >"${2}html"
	echo "<text x=\"90\" y=\"170\" font-family=\"monospace\" font-size=\"42\" style=\"font-weight: bold;\" fill=\"#5af\">$1</text>" >>"${2}svg"
	HEAD="$1"
	FL=1
}
function tip_footer(){
	# $1 - $S Строка из файла tip.txt
	# $2 - $F Имя конечного файла
	# $3 - 0 - Read more; 1 - <man cmd>.
	if [[ "$3" == 0 ]]
	then
		echo -e "</pre>\n<p class=\"readm\">$1<br>" >>"${2}html"
		echo "<text x=\"70\" y=\"595\" font-family=\"monospace\" font-size=\"27\" font-style=\"oblique\" fill=\"#fa0\">$1</text>" >>"${2}svg"
		FL=0
	elif [[ "$3" == 1 ]]
	then
		echo "$1</p>" >>"${2}html"
		echo "<text x=\"110\" y=\"625\" font-family=\"monospace\" font-size=\"27\" fill=\"#fa0\">$1</text>" >>"${2}svg"
	fi
}
function tip_str_quotes(){
	# $1 - $S Строка из файла tip.txt
	local SPAN='<span class="quotes">'
	local TSPAN='<tspan style="font-weight:bold;" fill="#f90">'
	RESHTML=$(sed "s%\(\"[^\"]*\"\)%$SPAN\1</span>%g; s%\('[^']*'\)%$SPAN\1</span>%g" <<< "$1")
	RES_SVG=$(sed "s%\(\"[^\"]*\"\)%$TSPAN\1</tspan>%g; s%\('[^']*'\)%$TSPAN\1</tspan>%g" <<< "$1")
}
function tip_str_cmnt(){
	# $1 - $S Строка из файла tip.txt
	RESHTML="<span class=\"comment\">#$1</span>"
	RES_SVG="<tspan fill=\"#0af\"  style=\"font-weight:normal;\">#$1</tspan>"
}
function tip_str_cmd(){
	# $1 - $S Строка из файла tip.txt
	R="${1//\</&lt;}"
	R="${R//\>/&gt;}"
	S="${R//#*/}"
	C="${R//*\#/}"
	if [[ "$C" == "$R" ]]; then C=; fi
	tip_str_quotes "$S"
	if [ -n "$C" ]
	then
		RESHTML="$RESHTML<span class=\"comment\">#$C</span>"
		RES_SVG="$RES_SVG<tspan fill=\"#0af\"  style=\"font-weight:normal;\">#$C</tspan>"
	fi
	RESHTML="<span class=\"cmd\">$RESHTML</span>"
	RES_SVG="<tspan  style=\"font-weight:bold;\" fill=\"#5f5\">$RES_SVG</tspan>"
}
function tip_make_text(){
	# $1 - $F Имя конечного файла
	if [[ ! -f "${1}txt" ]]
	then
		echo -e "заголовок\n# Код подсказки. Для прав root указываем так:\n$ su\n$ apt update\n# Завершаем подсказку так:\nRead more\nman apt\n" >"${1}txt"
	fi
	wait
	if [ -f ../tips.txt ]; then
		cp -f ../tips.txt "${1}txt"
	else
		touch "${1}txt"
		$EDITOR "${1}txt"
	fi
	if ! dialog --title "Что делаем?" --yesno "Подсказка готова?" 10 40
	then exit; fi
	FS=$(head -n 1 "${1}txt")
	echo -e "# ${FS}\n\`\`\`" >"${1}md"
	sed "1d; s%Read%\`\`\`\nRead%g" "${1}txt" >>"${1}md"
}
function tip_str_x(){
	# $1 - $S Строка из файла tip.txt
	# $2 - $FS Размер шрифта
	SPC=$(echo "$1" | sed 's%^\([\	]*\).*$%\1%' | wc -m)
	if [[ "$SPC" == 1 ]]
	then
		SPC=$(echo "$1" | sed 's%^\([\ ]*\).*$%\1%' | wc -m)
		SPC=$((SPC-1))
	else
		SPC=$(bc <<< "scale=1; ($SPC-1)*4.4")
	fi
	X=$(bc <<< "scale=1; ${2}/1.8*$SPC+50")
	TT="${TT//x=\"*\" y=/x=\"$X\" y=}"
}

tip_make_text "$F"
